	(33, 'public', 'cc', 63, '\r\nDROP TABLE IF EXISTS `public_cc`;# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).\r\n# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).\r\nCREATE TABLE IF NOT EXISTS `public_cc` (\r\n  `codc` varchar(12) CHARACTER SET utf8 NOT NULL,\r\n  `cc` varchar(30) CHARACTER SET utf8 DEFAULT NULL,\r\n  `centro` varchar(4) CHARACTER SET utf8 DEFAULT NULL, \r\n  `desceco` varchar(35) CHARACTER SET utf8 DEFAULT NULL,\r\n  `vale` varchar(1) CHARACTER SET utf8 DEFAULT NULL,\r\n  `validodel` date DEFAULT NULL,\r\n  `validoal` date DEFAULT NULL,\r\n  `explicacion` longtext CHARACTER SET utf8,\r\n  `clasecolector` char(1) CHARACTER SET utf8 NOT NULL,\r\n  `semaforopresup` char(1) COLLATE utf8_general_ci NOT NULL,\r\n  `codgrupo` varchar(4) CHARACTER SET utf8 NOT NULL,\r\n  `codclase` char(2) CHARACTER SET utf8 NOT NULL,\r\n  `correlativo` varchar(6) COLLATE utf8_general_ci NOT NULL\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).\r\n# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).\r\nALTER TABLE `public_cc`\r\n  ADD PRIMARY KEY (`codc`);# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).\r\n# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).\r\nALTER TABLE `public_cc`\r\nADD CONSTRAINT `public_cc_ibfk_1` FOREIGN KEY (`codgrupo`) REFERENCES `public_grupocc` (`codgrupo`),\r\nADD CONSTRAINT `public_cc_eibfk_2` FOREIGN KEY (`centro`) REFERENCES `public_centros` (`codcen`),\r\nADD CONSTRAINT `public_cc_ibfk_3` FOREIGN KEY (`codclase`) REFERENCES `public_clasecc` (`codclasecolector`);# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).\r\n# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).\r\n\r\n# MySQL ha devuelto un conjunto de valores vacío (es decir: cero columnas).', 1),
	(34, 'public', 'ccgastos', 64, 'DROP TABLE IF EXISTS `public_ccgastos`;\r\nCREATE TABLE IF NOT EXISTS `public_ccgastos` (\r\n  `id` int(11) NOT NULL,\r\n  `ceco` varchar(12) CHARACTER SET utf8 DEFAULT NULL,\r\n  `fechacontable` date DEFAULT NULL,\r\n  `monto` double DEFAULT NULL,\r\n  `codmoneda` varchar(3) CHARACTER SET utf8 DEFAULT NULL,\r\n  `usuario` varchar(25) CHARACTER SET utf8 DEFAULT NULL,\r\n  `idref` bigint(20) DEFAULT NULL,\r\n  `tipo` varchar(1) CHARACTER SET utf8 DEFAULT NULL, \r\n  `ano` char(4) COLLATE utf8_general_ci NOT NULL,\r\n  `mes` char(2) COLLATE utf8_general_ci NOT NULL,\r\n  `clasecolector` char(1) COLLATE utf8_general_ci NOT NULL,\r\n  `iduser` int(11) NOT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=964 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\nALTER TABLE `public_ccgastos`\r\n  ADD PRIMARY KEY (`id`), ADD KEY `ceco` (`ceco`);\r\n\r\nALTER TABLE `public_ccgastos`\r\n  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1;\r\n\r\nALTER TABLE `public_ccgastos`\r\nADD CONSTRAINT `public_ccgastos_ibfk_1` FOREIGN KEY (`ceco`) REFERENCES `public_cc` (`codc`),\r\nADD CONSTRAINT `public_ctytycgastos_ibfk_1` FOREIGN KEY (`codmoneda`) REFERENCES `public_monedas` (`codmoneda`)\r\n;\r\n', 1),
	(37, 'public', 'valorimpuestos', 68, '\r\n\r\n\r\nDROP TABLE IF EXISTS `public_valorimpuestos`;\r\nCREATE TABLE IF NOT EXISTS `public_valorimpuestos` (\r\n  `id` int(11) NOT NULL,\r\n  `hcodimpuesto` char(3) NOT NULL,\r\n  `valor` decimal(6,2) NOT NULL,\r\n  `finicio` date NOT NULL,\r\n  `ffinal` date NOT NULL,\r\n  `activo` char(1) NOT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;\r\n\r\nINSERT INTO `public_valorimpuestos` (`id`, `hcodimpuesto`, `valor`, `finicio`, `ffinal`, `activo`) VALUES\r\n(2, \'100\', \'19.00\', \'2005-05-01\', \'2012-08-01\', \'0\'),\r\n(3, \'100\', \'19.00\', \'2015-05-15\', \'2017-05-18\', \'0\'),\r\n(4, \'100\', \'19.00\', \'2013-07-12\', \'2014-11-27\', \'0\'),\r\n(5, \'100\', \'18.00\', \'2015-05-07\', \'2044-05-19\', \'1\'),\r\n(6, \'300\', \'5.00\', \'2015-05-01\', \'2019-05-31\', \'1\'),\r\n(7, \'200\', \'1.00\', \'2015-05-01\', \'2086-05-16\', \'1\'),\r\n(8, \'500\', \'8.00\', \'2013-10-03\', \'2023-10-28\', \'1\');\r\n\r\n\r\nALTER TABLE `public_valorimpuestos`\r\n  ADD PRIMARY KEY (`id`), ADD KEY `hcodimpuesto` (`hcodimpuesto`);\r\n\r\n\r\nALTER TABLE `public_valorimpuestos`\r\n  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=9;\r\n\r\nALTER TABLE `public_valorimpuestos`\r\nADD CONSTRAINT `public_valorimpuestos_ibfk_1` FOREIGN KEY (`hcodimpuesto`) REFERENCES `public_impuestos` (`codimpuesto`);', 1),
	(36, 'public', 'impuestos', 67, '\r\n\r\nDROP TABLE IF EXISTS `public_impuestos`;\r\nCREATE TABLE IF NOT EXISTS `public_impuestos` (\r\n  `codimpuesto` varchar(3) NOT NULL,\r\n  `descripcion` varchar(50) NOT NULL,\r\n  `abreviatura` varchar(8) NOT NULL,\r\n  `codsunat` varchar(4) NOT NULL,\r\n  `codune` varchar(3) NOT NULL\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8;\r\n\r\nINSERT INTO `public_impuestos` (`codimpuesto`, `descripcion`, `abreviatura`, `codsunat`, `codune`) VALUES\r\n(\'100\', \'IMPUESTO GENERAL A LAS VENTAS\', \'IGV\', \'0001\', \'VAT\'),\r\n(\'200\', \'IMPUESTO MUNICIPAL\', \'IPM\', \'XXXC\', \'\'),\r\n(\'300\', \'IMPUESTO SELECCTIVO AL COMSUMO\', \'ISC\', \'2000\', \'ISC\'),\r\n(\'400\', \'TASA DE DESPACHO ADUANERO\', \'TDA\', \'9999\', \'\'),\r\n(\'500\', \'IR CUARTA CATEGORIA\', \'IR4TA\', \'\', \'\');\r\n\r\n\r\nALTER TABLE `public_impuestos`\r\n  ADD PRIMARY KEY (`codimpuesto`);', 1),
	(38, 'public', 'grupocompras', 70, 'DROP TABLE IF EXISTS `public_grupocompras`;\r\nCREATE TABLE IF NOT EXISTS `public_grupocompras` (\r\n  `codgrupo` varchar(4) CHARACTER SET utf8 NOT NULL,\r\n  `codalm` varchar(3) CHARACTER SET utf8 DEFAULT NULL,\r\n  `nomgru` varchar(20) CHARACTER SET utf8 DEFAULT NULL,\r\n  `desgru` longtext CHARACTER SET utf8,  \r\n  `codsociedad` varchar(1) CHARACTER SET utf8 NOT NULL\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\n\r\nALTER TABLE `public_grupocompras`\r\n  ADD PRIMARY KEY (`codgrupo`),\r\nADD FOREIGN KEY (`codsociedad`) REFERENCES public_sociedades (`socio`);', 1),
	(39, 'public', 'usuariosfavoritos', 71, 'DROP TABLE IF EXISTS `public_usuariosfavoritos`;\r\nCREATE TABLE IF NOT EXISTS `public_usuariosfavoritos` (\r\n  `id` int(11) NOT NULL,\r\n  `hiduser` bigint(20) DEFAULT NULL,\r\n  `url` text CHARACTER SET utf8,\r\n  `fecharegistro` char(19) COLLATE utf8_general_ci DEFAULT NULL,\r\n  `valido` varchar(1) CHARACTER SET utf8 DEFAULT NULL,\r\n  `chapa` varchar(40) CHARACTER SET utf8 DEFAULT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\nALTER TABLE `public_usuariosfavoritos`\r\n  ADD PRIMARY KEY (`id`);\r\nALTER TABLE `public_usuariosfavoritos`\r\n  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1;', 1),
	(40, 'public', 'confignoticias', 72, '\r\nDROP TABLE IF EXISTS `public_confignoticias`;\r\nCREATE TABLE IF NOT EXISTS `public_confignoticias` (\r\n  `id` int(11) NOT NULL,\r\n  `iduseradm` int(11) NOT NULL,\r\n  `column_3` int(11) NOT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\n\r\nALTER TABLE `public_confignoticias`\r\n  ADD PRIMARY KEY (`id`);\r\n\r\n\r\nALTER TABLE `public_confignoticias`\r\n  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1;', 1),
	(41, 'public', 'noticias', 72, 'DROP TABLE IF EXISTS `public_noticias`;\r\nCREATE TABLE IF NOT EXISTS `public_noticias` (\r\n  `id` int(10) unsigned NOT NULL,\r\n  `txtnoticia` longtext CHARACTER SET utf8,\r\n  `fecha` char(19) COLLATE utf8_general_ci DEFAULT NULL,\r\n  `autor` varchar(50) CHARACTER SET utf8 DEFAULT NULL,\r\n  `expira` int(11) DEFAULT NULL,\r\n  `tiponoticia` varchar(2) CHARACTER SET utf8 DEFAULT NULL,\r\n  `mensaje` varchar(1) CHARACTER SET utf8 DEFAULT NULL,\r\n  `aprobado` int(11) DEFAULT NULL,\r\n  `fechapublicacion` char(19) COLLATE utf8_general_ci DEFAULT NULL,\r\n  `fechapropuesta` char(19) COLLATE utf8_general_ci DEFAULT NULL,\r\n  `fexpira` char(19) COLLATE utf8_general_ci DEFAULT NULL,\r\n  `iduser` int(11) NOT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\n\r\nALTER TABLE `public_noticias`\r\n  ADD PRIMARY KEY (`id`);\r\n\r\n\r\nALTER TABLE `public_noticias`\r\n  MODIFY `id` int(10) unsigned NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1;', 1),
	(42, 'public', 'ubigeos', 73, 'CREATE TABLE `public_ubigeos` (\r\n	`coddep` VARCHAR(2) NOT NULL,\r\n	`codprov` VARCHAR(2) NOT NULL,\r\n	`coddist` VARCHAR(2) NOT NULL,\r\n	`departamento` VARCHAR(40) NOT NULL,\r\n	`provincia` VARCHAR(40) NOT NULL,\r\n	`distrito` VARCHAR(40) NOT NULL,\r\n	`id` INT(11) NOT NULL,\r\n	UNIQUE INDEX `coddep` (`coddep`, `codprov`, `coddist`),\r\n	INDEX `Índice 1` (`codprov`, `coddep`, `coddist`)\r\n)\r\nCOLLATE=\'utf8_general_ci\'\r\nENGINE=InnoDB\r\n;', 1),
	(115, 'vw', 'atencionessolpe', 176, 'drop view if exists  `vw_atencionessolpe`;\r\nCREATE  VIEW `vw_atencionessolpe` AS select `d`.`item` AS `item`,`d`.`id` AS `iddesolpe`,`d`.`cant` AS `cantdesolpe`,`h`.`numvale` AS `numvale`,`k`.`desum` AS `desumsolpe`,`d`.`hidsolpe` AS `idsolpe`,`d`.`um` AS `umsolpe`,`u`.`cant` AS `cantreserva`,`u`.`codocu` AS `codocu`,`u`.`numreserva` AS `numreserva`,`u`.`estadoreserva` AS `estadoreserva`,`t`.`id` AS `id`,`s`.`cant` AS `cant`,`t`.`hidreserva` AS `hidreserva`,`t`.`hidkardex` AS `hidkardex`,`t`.`estadoatencion` AS `estadoatencion`,`s`.`codmov` AS `codmov`,`s`.`um` AS `um`,`s`.`numkardex` AS `numkardex`,`s`.`usuario` AS `usuario`,`s`.`codart` AS `codart`,`s`.`preciounit` AS `preciounit`,`s`.`fecha` AS `fecha`,`g`.`monto` AS `monto`,`g`.`ceco` AS `ceco`,`d`.`txtmaterial` AS `txtmaterial`,`j`.`desum` AS `desumkardex`,`f`.`movimiento` AS `movimiento`,`s`.`iduser` AS `iduser` from (((((((((`public_solpe` `x` join `public_desolpe` `d` on((`x`.`id` = `d`.`hidsolpe`))) join `public_alkardex` `s` on(((`s`.`idref` = `d`.`id`) and (`s`.`codocuref` = `x`.`codocu`)))) left join `public_atencionreserva` `t` on((`s`.`id` = `t`.`hidkardex`))) left join `public_alreserva` `u` on((`u`.`id` = `t`.`hidreserva`))) left join `public_ums` `k` on((`k`.`um` = `d`.`um`))) left join `public_ccgastos` `g` on((`g`.`idref` = `s`.`id`))) left join `public_almacendocs` `h` on((`h`.`id` = `s`.`hidvale`))) left join `public_almacenmovimientos` `f` on((`f`.`codmov` = `s`.`codmov`))) left join `public_ums` `j` on((`j`.`um` = `s`.`um`)));\r\n\r\n', 0),
	(116, 'public', 'ActiveRecordLog', 177, 'DROP TABLE IF EXISTS `ActiveRecordLog`;\r\nCREATE TABLE IF NOT EXISTS `ActiveRecordLog` (\r\n  `id` int(10) unsigned NOT NULL,\r\n  `description` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\r\n  `action` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,\r\n  `model` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,\r\n  `idModel` int(10) unsigned DEFAULT NULL,\r\n  `field` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,\r\n  `creationdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\r\n  `userid` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,\r\n  `idModelReal` varchar(20) COLLATE utf8_unicode_ci NOT NULL,\r\n  `oldvalue` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,\r\n  `newvalue` varchar(20) COLLATE utf8_unicode_ci NOT NULL,\r\n  `nombrecampo` varchar(30) COLLATE utf8_unicode_ci NOT NULL,\r\n  `campo1` varchar(10) COLLATE utf8_unicode_ci NOT NULL,\r\n  `campo2` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,\r\n  `campo3` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;\r\n\r\n\r\nALTER TABLE `ActiveRecordLog`\r\n  ADD PRIMARY KEY (`id`);\r\n  \r\nALTER TABLE `ActiveRecordLog`\r\n  ADD key  (`model`);\r\n\r\n\r\nALTER TABLE `ActiveRecordLog`\r\n  MODIFY `id` int(10) unsigned NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1;', 0),
	(117, 'public', 'tipimputa', 179, '\r\nDROP TABLE IF EXISTS `public_tipimputa`;\r\nCREATE TABLE IF NOT EXISTS `public_tipimputa` (\r\n  `codimpu` varchar(1) NOT NULL,\r\n  `desimputa` varchar(15) DEFAULT NULL,\r\n  `validacion` varchar(45) NOT NULL\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8;\r\n\r\nINSERT INTO `public_tipimputa` (`codimpu`, `desimputa`, `validacion`) VALUES\r\n(\'B\', \'CENTRO BENEFI\', \'Cc\'),\r\n(\'F\', \'ORDEN DE VENTA\', \'Peticion\'),\r\n(\'I\', \'PROYECTO\',  \'\'),\r\n(\'K\', \'CENTRO DE COSTO\',  \'Cc\'),\r\n(\'P\', \'ORDEN PROD\', \'\'),\r\n(\'T\', \'ORDEN TRAB\',  \'\');\r\n\r\n\r\nALTER TABLE `public_tipimputa`', 0),
	(172, 'public', 'dlote', 275, 'DROP TABLE IF EXISTS `public_dlote`;\r\n CREATE TABLE `public_dlote` (\r\n	`id` BIGINT(20) NOT NULL AUTO_INCREMENT,\r\n	`hidlote` BIGINT(20) NOT NULL,\r\n	`cant` DOUBLE NOT NULL,\r\n	`hidkardex` BIGINT(20) NOT NULL,\r\n	`stock` VARCHAR(12) NULL DEFAULT NULL,\r\n	`iduser` INT(11) NOT NULL,\r\n	PRIMARY KEY (`id`),\r\n	INDEX `hidlote_2` (`hidlote`),\r\n	INDEX `hidkardex` (`hidkardex`),\r\n	INDEX `Índice 4` (`stock`),\r\n	CONSTRAINT `public_dlote_ibfk_1` FOREIGN KEY (`hidlote`) REFERENCES `public_lotes` (`id`),\r\n	CONSTRAINT `public_dlote_ibfk_2` FOREIGN KEY (`hidkardex`) REFERENCES `public_alkardex` (`id`)\r\n)\r\nCOMMENT=\'GUARDA LOS DESPACHOS DEL LOTE AL DETALLE\'\r\nCOLLATE=\'utf8_general_ci\'\r\nENGINE=InnoDB\r\nAUTO_INCREMENT=16\r\n;\r\n', 0),
	(178, 'vw', 'costos', 282, 'drop view if exists `vw_costos`;\r\nCREATE  VIEW `vw_costos` AS select `z`.`id` AS `id`,`z`.`ceco` AS `ceco`,\r\n`z`.`fechacontable` AS `fechacontable`,`z`.`monto` AS `monto`,`z`.`codmoneda` AS `codmoneda`,\r\n`z`.`usuario` AS `usuario`,`z`.`idref` AS `idref`,`z`.`tipo` AS `tipo`,\r\n`z`.`ano` AS `ano`,`z`.`mes` AS `mes`,`z`.`clasecolector` AS `clasecolector`,\r\n`z`.`iduser` AS `iduser`,`s`.`numvale` AS `numvale`,`t`.`codart` AS `codart`,\r\n`t`.`codmov` AS `codmov`,`t`.`valido` AS `valido`,`t`.`destino` AS `destino`,\r\n`t`.`checki` AS `checki`,`t`.`cant` AS `cant`,`t`.`alemi` AS `alemi`,\r\n`t`.`aldes` AS `aldes`,`t`.`fecha` AS `fecha`,`t`.`coddoc` AS `coddoc`,\r\n`t`.`numdoc` AS `numdoc`,`t`.`um` AS `um`,`t`.`comentario` AS `comentario`,\r\n`t`.`codocuref` AS `codocuref`,`t`.`numdocref` AS `numdocref`,\r\n`t`.`codcentro` AS `codcentro`,`t`.`id` AS `idkardex`,\r\n`t`.`codestado` AS `codestado`,`t`.`prefijo` AS `prefijo`,\r\n`t`.`fechadoc` AS `fechadoc`,`t`.`correlativo` AS `correlativo`,\r\n`t`.`numkardex` AS `numkardex`,`t`.`solicitante` AS `solicitante`,\r\n`t`.`hidvale` AS `hidvale`,`a`.`descripcion` AS `descripcion`,\r\n`b`.`desdocu` AS `desdocu`,`c`.`movimiento` AS `movimiento`,\r\n`x`.`desum` AS `desum` from ((((((`public_alkardex` `t` join `public_maestrocomponentes` `a`) join\r\n `public_documentos` `b`) join `public_almacenmovimientos` `c`) join `public_ums` `x`) join\r\n  `public_almacendocs` `s`) join `public_ccgastos` `z`) where ((`s`.`id` = `t`.`hidvale`) \r\n  and (`t`.`codart` = `a`.`codigo`) and (`t`.`codocuref` = `b`.`coddocu`) and (`t`.`codmov` = `c`.`codmov`)\r\n   and (`t`.`um` = `x`.`um`) and (`t`.`id` = `z`.`idref`));', 0),
	(173, 'public', 'almacentransacciones', 15, 'drop table if exists  `public_almacentransacciones`;\r\nCREATE TABLE `public_almacentransacciones` (\r\n	`codal` VARCHAR(3) NOT NULL,\r\n	`codmov` VARCHAR(2) NOT NULL,\r\n	`activo` CHAR(1) NULL DEFAULT NULL,\r\n	PRIMARY KEY (`codal`, `codmov`),\r\n	INDEX `FK__public_almacenmovimientos` (`codmov`),\r\n	CONSTRAINT `FK__public_almacenes` FOREIGN KEY (`codal`) REFERENCES `public_almacenes` (`codalm`),\r\n	CONSTRAINT `FK__public_almacenmovimientos` FOREIGN KEY (`codmov`) REFERENCES `public_almacenmovimientos` (`codmov`)\r\n)\r\nENGINE=InnoDB\r\n;', 0),
	(174, 'vw', 'trazabilidad_reservas', 276, 'drop view IF EXISTS `vw_trazabilidad_reservas`;\r\nselect  `a`.`hidesolpe` AS `hidesolpe`,`a`.`id` AS `id`,`a`.`fechares` AS `fecha_reserva`,\r\n `a`.`codocu` AS `codocu`,`a`.`estadoreserva` AS `estadoreserva`,`c`.`montomovido` AS `montomovido`,\r\n `c`.`cant` AS `cant`,`a`.`usuario` AS `usuario_reserva`,`f`.`desdocu` AS `desdocu_reserva`,\r\n `u`.`desum` AS `umsolic`,`uu`.`desum` AS `umatem`,`a`.`cant` AS `cantidad_reservada`,\r\n `b`.`cant` AS `cantidad_atendida`,`g`.`id` AS `idvale`,`g`.`fechacont` AS `fecha_atencion_vale`,\r\n `g`.`numvale` AS `numero_vale_atencion`,`x`.`fechacrea` AS `fecha_solicitud_compra`,\r\n `r`.`numero` AS `solicitud_compra`,`j`.`fecdoc` AS `fecha_compra`,`j`.`numcot` AS `orden_compra`,\r\n `k`.`numvale` AS `vale_ingreso_compra_almacen`,`k`.`fechacont` AS `fecha_vale_ingreso_almacen`,\r\n `s`.`cant` AS `xx` from (((((((((((((((`public_alreserva` `a`\r\n  left join `public_documentos` `f` on((`f`.`coddocu` = `a`.`codocu`))) left join \r\n  `public_atencionreserva` `b` on((`a`.`id` = `b`.`hidreserva`))) left join \r\n  `public_alkardex` `c` on((`b`.`hidkardex` = `c`.`id`))) left join \r\n  `public_ums` `uu` on((`c`.`um` = `uu`.`um`)))\r\n   left join `public_almacendocs` `g` on((`g`.`id` = `c`.`hidvale`)))	left join \r\n	`public_desolpe` `x` on((`x`.`idreserva` = `a`.`id`))) left join\r\n	 `public_solpe` `r` on((`x`.`hidsolpe` = `r`.`id`))) left join \r\n	 `public_desolpecompra` `y` on((`x`.`id` = `y`.`iddesolpe`))) left join \r\n	 `public_desolpe` `v` on((`v`.`id` = `y`.`iddesolpe`))) left join \r\n	 `public_ums` `u` on((`u`.`um` = `v`.`um`))) left join \r\n	 `public_solpe` `w` on((`w`.`id` = `v`.`hidsolpe`))) left join\r\n	  `public_docompra` `z` on((`z`.`id` = `y`.`iddocompra`))) left join \r\n	  `public_ocompra` `j` on((`j`.`idguia` = `z`.`hidguia`))) left join \r\n	  `public_alkardex` `s` on((`s`.`idref` = `x`.`id`)  and s.codocuref=x.codocu    )) left join \r\n	  `public_almacendocs` `k` on((`k`.`id` = `s`.`hidvale`)));\r\n', 0),
