	(101, 'public', 'montoinventario', 163, 'DROP TABLE IF EXISTS `public_montoinventario`;\r\nCREATE TABLE IF NOT EXISTS `public_montoinventario` (\r\n  `id` mediumint(9) NOT NULL,\r\n  `dia` char(2) COLLATE utf8_unicode_ci NOT NULL,\r\n  `mes` char(2) COLLATE utf8_unicode_ci NOT NULL,\r\n  `anno` char(2) COLLATE utf8_unicode_ci NOT NULL,\r\n  `iduser` int(11) NOT NULL,\r\n  `montolibre` decimal(15,3) NOT NULL,\r\n  `montoreserva` decimal(15,3) NOT NULL,\r\n  `montotran` decimal(15,3) NOT NULL,\r\n  `montodif` decimal(15,3) NOT NULL,\r\n  `codal` char(3) CHARACTER SET utf8 NOT NULL,\r\n  `codcen` char(4) COLLATE utf8_general_ci NOT NULL,\r\n  `codgrupo` varchar(4) COLLATE utf8_general_ci NOT NULL,\r\n  `numitems` mediumint(9) NOT NULL,\r\n  `fecha` date NOT NULL,\r\n  `montototal` decimal(16,0) NOT NULL,\r\n  `semana` varchar(4) CHARACTER SET utf8 NOT NULL\r\n) ENGINE=InnoDb AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\n\r\nALTER TABLE `public_montoinventario`\r\n  ADD PRIMARY KEY (`id`);\r\n\r\n\r\nALTER TABLE `public_montoinventario`\r\n  MODIFY `id` mediumint(9) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1;', 0),
