	(103, 'public', 'maletin', 162, 'DROP TABLE IF EXISTS `public_maletin`;\r\nCREATE TABLE IF NOT EXISTS `public_maletin` (\r\n  `idregistro` bigint(20) NOT NULL,\r\n  `clase` varchar(35) NOT NULL,\r\n  `iduser` int(11) NOT NULL,\r\n  `idsession` int(11) NOT NULL,\r\n  `codocu` varchar(3) NOT NULL,\r\n  `id` bigint(20) NOT NULL\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8;\r\n\r\n\r\nALTER TABLE `public_maletin`\r\n  ADD PRIMARY KEY (`id`),\r\n  add key (`codocu`)\r\n  ;\r\n\r\n\r\nALTER TABLE `public_maletin`\r\n  MODIFY `id` bigint(20) NOT NULL AUTO_INCREMENT;', 0),
	(104, 'public', 'inventario', 165, 'DROP TABLE IF EXISTS `public_inventario`;\r\nCREATE TABLE IF NOT EXISTS `public_inventario` (\r\n  `codigo` varchar(6) CHARACTER SET utf8 DEFAULT NULL,\r\n  `c_estado` varchar(1) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codep` varchar(3) CHARACTER SET utf8 DEFAULT NULL,\r\n  `comentario` longtext CHARACTER SET utf8,\r\n  `fecha` char(19) COLLATE utf8_general_ci DEFAULT NULL,\r\n  `coddocu` varchar(3) CHARACTER SET utf8 DEFAULT NULL, \r\n  `codlugar` varchar(6) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codigosap` varchar(6) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codigoaf` varchar(14) CHARACTER SET utf8 DEFAULT NULL,\r\n  `descripcion` varchar(40) CHARACTER SET utf8 DEFAULT NULL,\r\n  `marca` varchar(15) CHARACTER SET utf8 DEFAULT NULL,\r\n  `modelo` varchar(25) CHARACTER SET utf8 DEFAULT NULL,\r\n  `serie` varchar(20) CHARACTER SET utf8 DEFAULT NULL,\r\n  `clasefoto` varchar(30) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codigopadre` varchar(5) CHARACTER SET utf8 DEFAULT NULL,\r\n  `numerodocumento` varchar(20) CHARACTER SET utf8 DEFAULT NULL,\r\n  `adicional` varchar(15) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codigoafant` varchar(10) CHARACTER SET utf8 DEFAULT NULL,\r\n  `posicion` varchar(6) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codcentro` varchar(4) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codcentrooriginal` varchar(4) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codeporiginal` varchar(3) CHARACTER SET utf8 DEFAULT NULL,\r\n  `rocoto` varchar(1) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codepanterior` varchar(3) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codcentroanterior` varchar(4) CHARACTER SET utf8 DEFAULT NULL,\r\n  `clase` varchar(4) CHARACTER SET utf8 DEFAULT NULL,\r\n  `baja` varchar(1) CHARACTER SET utf8 DEFAULT NULL,\r\n  `n_direc` bigint(20) DEFAULT NULL,\r\n  `ubicacion` varchar(40) CHARACTER SET utf8 DEFAULT NULL,\r\n  `tipo` varchar(2) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codestado` varchar(2) CHARACTER SET utf8 DEFAULT NULL,\r\n  `tienecarter` varchar(1) CHARACTER SET utf8 DEFAULT NULL,\r\n  `codarea` varchar(3) CHARACTER SET utf8 DEFAULT NULL,\r\n  `iddocu` bigint(20) DEFAULT NULL,\r\n  `codigodoc` varchar(3) CHARACTER SET utf8 DEFAULT NULL,\r\n  `portransporte` varchar(1) CHARACTER SET utf8 DEFAULT NULL,\r\n  `historial` int(11) DEFAULT NULL,\r\n  `hidpadre` int(11) DEFAULT NULL,\r\n  `codpropietario` varchar(4) CHARACTER SET utf8 NOT NULL,\r\n  `idinventario` bigint(20) NOT NULL,\r\n  `codmaster` varchar(10) COLLATE utf8_general_ci NOT NULL,\r\n  `flagdesarmado` char(1) COLLATE utf8_general_ci NOT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\n\r\nALTER TABLE `public_inventario`\r\n  ADD PRIMARY KEY (`idinventario`), \r\n  ADD KEY `fki_PK_CODLUGAR` (`codlugar`), \r\n  ADD KEY `fki_estad` (`codestado`,`codigodoc`), \r\n  ADD KEY `fki_dlssfslkflsf` (`codlugar`),\r\n   ADD KEY `codpropietario` (`codpropietario`),\r\n	 ADD KEY `coddocu` (`coddocu`);\r\n\r\n\r\nALTER TABLE `public_inventario`\r\n  MODIFY `idinventario` bigint(20) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=1;\r\n\r\nALTER TABLE `public_inventario`\r\nADD CONSTRAINT `public_inventario_ibfk_1` FOREIGN KEY (`coddocu`) REFERENCES `public_documentos` (`coddocu`);\r\nALTER TABLE `public_inventario`\r\nADD  FOREIGN KEY (`codep`) REFERENCES `public_embarcaciones` (`codep`);\r\nALTER TABLE `public_inventario`\r\nADD  FOREIGN KEY (`codlugar`) REFERENCES `public_lugares` (`codlugar`);\r\nALTER TABLE `public_inventario`\r\nADD  FOREIGN KEY (`tipo`) REFERENCES `public_tipomaquina` (`codtipo`);\r\nALTER TABLE `public_inventario`\r\nADD  FOREIGN KEY ( `coddocu`, `codestado`) REFERENCES `public_estado` (`codocu`, `codestado`);\r\nALTER TABLE `public_inventario`\r\nADD  FOREIGN KEY ( `codarea`) REFERENCES `public_areas` (`codarea`);\r\nALTER TABLE `public_inventario`\r\nADD  FOREIGN KEY ( `codpropietario`) REFERENCES `public_centros` (`codcen`);\r\nALTER TABLE `public_inventario`\r\nADD  FOREIGN KEY ( `codmaster`) REFERENCES `public_masterequipo` (`codigo`);', 0),
	(105, 'vw', 'lugares', 166, 'DROP VIEW IF EXISTS  `vw_lugares`;\r\ncreate  VIEW `vw_lugares` AS select `a`.`despro` AS `despro`,`b`.`codlugar` AS `codlugar`,\r\n `b`.`deslugar` AS `deslugar`,`b`.`claselugar` AS `claselugar`,\r\n `b`.`codpro` AS `codpro`,`b`.`id` AS `id`,`b`.`n_direc` AS `n_direc`,\r\n `c`.`c_direc` AS `c_direc`,`d`.`departamento` AS `departamento`,\r\n `d`.`provincia` AS `provincia`,`d`.`distrito` AS `distrito`,\r\n count(`x`.`codlugar`) AS `numeroactivos` from ((((`public_clipro` `a` join \r\n `public_lugares` `b` on((`a`.`codpro` = `b`.`codpro`))) join \r\n `public_direcciones` `c` on((`c`.`n_direc` = `b`.`n_direc`))) join \r\n `public_ubigeos` `d` on(((`c`.`coddepa` = `d`.`coddep`) and \r\n (`c`.`codprov` = `d`.`codprov`) and (`c`.`coddist` = `d`.`coddist`)))) left join\r\n  `public_inventario` `x` on((`x`.`codlugar` = `b`.`codlugar`)))\r\n   group by `a`.`despro`,`b`.`codlugar`,`b`.`deslugar`,`b`.`claselugar`,\r\n	`b`.`codpro`,`b`.`n_direc`,`c`.`c_direc`,`d`.`departamento`,\r\n	`d`.`provincia`,`d`.`distrito`;', 0),
	(176, 'vw', 'solpeparacomprar', 280, 'drop view IF EXISTS `vw_solpeparacomprar`;\r\nCREATE  VIEW `vw_solpeparacomprar` AS select `a`.`escompra` AS `escompra`,b.textodetalle,`a`.`numero` AS `numero`,`a`.`estado` AS `estado`,`b`.`item` AS `item`,`b`.`id` AS `id`,`b`.`est` AS `est`,`b`.`tipimputacion` AS `tipimputacion`,`b`.`punitplan` AS `punitplan`,`a`.`id` AS `identidad`,`b`.`fechaent` AS `fechaent`,`b`.`fechacrea` AS `fechacrea`,`b`.`usuario` AS `usuario`,`b`.`um` AS `um`,`b`.`tipsolpe` AS `tipsolpe`,`b`.`centro` AS `centro`,`b`.`codal` AS `codal`,`b`.`codart` AS `codart`,`b`.`imputacion` AS `imputacion`,`b`.`cant` AS `cant`,`d`.`desum` AS `desum`,`b`.`txtmaterial` AS `txtmaterial`,sum(`c`.`cant`) AS `cantatendida`,(`b`.`cant` - sum(`c`.`cant`)) AS `cant_pendiente` from (((`public_solpe` `a` join `public_desolpe` `b` on((`a`.`id` = `b`.`hidsolpe`))) left join `public_desolpecompra` `c` on((`b`.`id` = `c`.`iddesolpe`))) join `public_ums` `d` on((`d`.`um` = `b`.`um`))) where (`a`.`escompra` = \'1\') group by `a`.`escompra`,`a`.`numero`,`a`.`fechanec`,`b`.`centro`,`b`.`txtmaterial`,`b`.`codal`,`b`.`codart`,`b`.`imputacion`,`b`.`cant`,`d`.`desum` having ((sum(`c`.`cant`) < `cant`) or isnull(sum(`c`.`cant`))) ', 0),
	(108, 'vw', 'opcionesdocumentos', 169, 'drop VIEW IF EXISTS `vw_opcionesdocumentos`;\r\nCREATE VIEW `vw_opcionesdocumentos` AS select \r\n`documentos`.`desdocu` AS `desdocu`,`opcionesdocumentos`.`idopdoc` AS \r\n`idopdoc`,`opcionescamposdocu`.`campo` AS `campo`,`opcionescamposdocu`.`nombrecampo` AS\r\n `nombrecampo`,`opcionescamposdocu`.`nombredelmodelo` AS\r\n  `nombredelmodelo`,`opcionescamposdocu`.`tipodato` AS \r\n  `tipodato`,`opcionescamposdocu`.`longitud` AS\r\n   `longitud`,`opcionesdocumentos`.`id` AS `id`,`opcionesdocumentos`.`idusuario` AS \r\n	`idusuario`,`cruge_user`.`username` AS `username`,`documentos`.`coddocu` AS\r\n	 `coddocu`,`opcionesdocumentos`.`valor` AS `valor`,`opcionescamposdocu`.`seleccionable` AS \r\n	 `seleccionable` from (((`public_documentos` `documentos` join `cruge_user`) join \r\n	 `public_opcionescamposdocu` `opcionescamposdocu`) join \r\n	 `public_opcionesdocumentos` `opcionesdocumentos`) where \r\n	 ((`documentos`.`coddocu` = `opcionescamposdocu`.`codocu`) and \r\n	 (`opcionesdocumentos`.`idopdoc` = `opcionescamposdocu`.`id`) and \r\n	 (`opcionesdocumentos`.`idusuario` = `cruge_user`.`iduser`));', 0),
	(109, 'public', 'fondofijo', 170, '\r\nDROP TABLE IF EXISTS `public_fondofijo`;\r\nCREATE TABLE IF NOT EXISTS `public_fondofijo` (\r\n  `id` int(11) NOT NULL,\r\n  `desfondo` varchar(60) CHARACTER SET utf8 NOT NULL,\r\n  `codtra` varchar(4) CHARACTER SET utf8 NOT NULL,\r\n  `codcen` varchar(4) CHARACTER SET utf8 NOT NULL,\r\n  `iduser` int(11) NOT NULL,\r\n  `fondo` decimal(10,2) DEFAULT NULL,\r\n  `codmon` varchar(3) CHARACTER SET utf8 NOT NULL,\r\n  `numerodias` int(11) NOT NULL,\r\n  `socio` char(1) CHARACTER  SET utf8 NOT NULL,\r\n  `gastomax` decimal(10,2) DEFAULT NULL,\r\n  `rojo` decimal(10,2) DEFAULT NULL,\r\n  `naranja` decimal(10,2) DEFAULT NULL,\r\n  `azul` decimal(10,2) DEFAULT NULL,\r\n  `codarea` varchar(3) COLLATE utf8_general_ci DEFAULT NULL,\r\n  `ejercicio` varchar(4) COLLATE utf8_general_ci NOT NULL,\r\n  `porctolerancia` int(11) NOT NULL\r\n) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;\r\n\r\n\r\nALTER TABLE `public_fondofijo`\r\n  ADD PRIMARY KEY (`id`), ADD KEY `codtra` (`codtra`), ADD KEY `codcen` (`codcen`);\r\n\r\n\r\nALTER TABLE `public_fondofijo`\r\n  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT,AUTO_INCREMENT=2;\r\n\r\nALTER TABLE `public_fondofijo`\r\nADD CONSTRAINT `public_fondofijo_ibfk_1` FOREIGN KEY (`codtra`) REFERENCES `public_trabajadores` (`codigotra`),\r\nADD CONSTRAINT `public_fondofijo_ibfk_2` FOREIGN KEY (`codcen`) REFERENCES `public_centros` (`codcen`);\r\n\r\nALTER TABLE `public_fondofijo`\r\nADD  FOREIGN KEY (`codmon`) REFERENCES `public_monedas` (`codmoneda`);\r\n\r\nALTER TABLE `public_fondofijo`\r\nADD  FOREIGN KEY (`codarea`) REFERENCES `public_areas` (`codarea`);\r\n\r\n\r\nALTER TABLE `public_fondofijo`\r\nADD  FOREIGN KEY (`socio`) REFERENCES `public_sociedades` (`socio`);', 0),
	(110, 'vw', 'trabajadores', 174, 'drop VIEW if exists `vw_trabajadores`;\r\nCREATE VIEW `vw_trabajadores` AS select `trabajadores`.`codigotra` AS \r\n`codigotra`,concat(`trabajadores`.`ap`,\'-\',`trabajadores`.`am`,\'-\',`trabajadores`.`nombres`) AS\r\n `nombrecompleto`,`trabajadores`.`codpuesto` AS `codpuesto`,`trabajadores`.`ap` AS \r\n `ap`,`trabajadores`.`am` AS `am`,`trabajadores`.`nombres` AS `nombres`,`trabajadores`.`dni` AS\r\n  `dni`,`oficios`.`oficio` AS `oficio` from (`public_trabajadores` `trabajadores` join \r\n  `public_oficios` `oficios`) where (`trabajadores`.`codpuesto` = `oficios`.`codof`);', 0),
	(162, 'vw', 'alinventario', 251, 'drop view if exists `vw_alinventario` ;\r\nCREATE  VIEW `vw_alinventario` \r\nAS select x.numlote, x.cant as cantlote, x.fechavenc, x.fechafabri, x.punit as punitlote, x.orden as ordenlote, `t`.`codalm` AS `codalm`,`t`.`fechainicio` AS `fechainicio`,\r\n`t`.`fechafin` AS `fechafin`,`t`.`periodocontable` AS `periodocontable`,\r\n`t`.`codresponsable` AS `codresponsable`,`t`.`codart` AS `codart`,\r\n`t`.`codcen` AS `codcen`,`c`.`um` AS `um`,`t`.`cantlibre` AS `cantlibre`,\r\n`t`.`canttran` AS `canttran`,`t`.`cantres` AS `cantres`,\r\n`t`.`ubicacion` AS `ubicacion`,`t`.`lote` AS `lote`,\r\n`t`.`siid` AS `siid`,`t`.`ssiduser` AS `ssiduser`,\r\n`t`.`id` AS `id`,`t`.`punit` AS `punit`,`t`.`codmon` AS `codmon`,`a`.`descripcion` AS `descripcion`,\r\n`a`.`codtipo` AS `codtipo`,`c`.`desum` AS `desum`,round((`t`.`punit` * `t`.`cantlibre`),3) AS `ptlibre`,\r\nround((`t`.`punit` * `t`.`canttran`),3) AS `pttran`,\r\nround((`t`.`punit` * `t`.`cantres`),3) AS `ptres`,\r\nround((((`t`.`punit` * `t`.`cantlibre`) + (`t`.`punit` * `t`.`canttran`)) +\r\n (`t`.`punit` * `t`.`cantres`)),3) AS `pttotal` \r\n from `public_alinventario` `t` left join\r\n  `public_lotes` `x` on (t.id=x.hidinventario)  inner  join \r\n  `public_maestrocomponentes` `a`  on (`t`.`codart` = `a`.`codigo`)  inner join \r\n `public_ums` `c`  on (`a`.`um` = `c`.`um`)  where x.cant is null or x.cant > 0', 0),
